import React from "react";
import { Row } from "simple-flexbox";
import { StyleSheet, css } from "aphrodite";
import Logo from "../../assets/partnrd_logo.jpg.png";


const styles = StyleSheet.create({
  container: {
    marginLeft: 32,
    marginRight: 32,
  },
  title: {
    fontFamily: "Muli",
    fontStyle: "normal",
    fontWeight: "bold",
    fontSize: 22,
    lineHeight: "24px",
    letterSpacing: "0.5px",
    color: "#A4A6B3",
    opacity: 1.0,
  },

  logo: {
    borderRadius: 0,
    backgroundColor: "#FFFFFF",
    maxHeight: 80,
    maxWidth: 80
  }
});

function LogoComponent() {
  return (
    <Row
      className={css(styles.container)}
      horizontal="center"
      vertical="center"
    >
      <img className={css(styles.logo)}src={Logo} alt="logo"/>
      {/* <span className={css(styles.title)}>Partnrd</span> */}
    </Row>
  );
}

export default LogoComponent;
